import { Card } from "react-bootstrap";

export default function MyCard(props){
    let path = `/courses/${props.course.id}/lesson`



    return(
        <col md={4} xs={12}>
            <Card >
            <Card.Img variant="top" src={props.course.image} Fluid/>
            <Card.Body>
                <Card.Title>(props.course.subject)</Card.Title>
                <Card.Text>
                    Ngay Tao: {props.course.created_date}
                </Card.Text>
           </Card.Body>
            </Card>
        </col>
    )
}
